CREATE TABLE [Apple_tv] 
(
    [id]	VARCHAR(512),
    [title]	VARCHAR(512),
    [type]	VARCHAR(512),
    [release_year]	INT,
    [age_certification]	VARCHAR(512),
    [runtime]	INT,
    [genres]	VARCHAR(512),
    [production_countries]	VARCHAR(512),
    [seasons]	INT,
    [imdb_id]	VARCHAR(512),
    [imdb_score]	DECIMAL(10,1),
    [imdb_votes]	INT,
    [tmdb_popularity]	INT,
    [tmdb_score]	DECIMAL(10,1)
);

